"ko": |-
  seq: 요청의 직접적인 결과인 스트림의 첫 번째 패킷의 시퀀스 번호를 나타냅니다. 이를 통해 클라이언트는 탐색 시 패킷을 우아하게 처리할 수 있습니다. 클라이언트는 이 값을 사용하여 검색 이전에 발생한 패킷과 검색 이후에 발생한 패킷을 구별합니다. 클라이언트는 패킷 손실이나 재정렬로 인해 표시된 시퀀스 번호의 패킷을 수신하지 못하고 대신 더 높은 시퀀스 번호의 패킷을 수신할 수 있다는 점에 유의하십시오. 이 매개변수는 존재하는 것이 좋습니다.
